import { HashRouter, Route, Switch } from "react-router-dom"
import App from './App'
import Login from './page/login'
import Admin from './admin'

export default class IRouter extends React.Component {
  render() {
    return (

      <HashRouter>
        <App>
          <div>
            <Route path='/login' conponent={Login}/>
          </div>
        </App>
      </HashRouter>
    )
  }
}

